// Layout.js

import React from 'react';
import CustomToolbar from './CustomToolbar';

const Layout = ({ children }) => {
  return (
    <div>
      <CustomToolbar />
      <main>{children}</main>
      {/* Other components and content */}
    </div>
  );
};

export default Layout;
